// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./ManufacturerContract.sol";
import "./ManufacturerFactory.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

/**
    @title AuthorityContract
    @notice This contract reflects the Authority in the ARD process. Inherits from OpenZeppelin Ownable, SOFIE InterledgerSenderInterface and InterledgerReceiverInterface
 */
contract AuthorityContract is AccessControl{

    bytes32 public constant AUTHORIY = keccak256("AUTHORIY");
    bytes32 public constant ACCREDITOR = keccak256("ACCREDITOR");
    bytes32 public constant LABORATORY = keccak256("LABORATORY");
    bytes32 public constant MANUFACTURER = keccak256("MANUFACTURER");




    /**
        Contract state attributes
     */

    
    // Address of the Factory smart contract to deploy Manufacturer contracts
    ManufacturerFactory public factory;

    // Data structures to map the address of a ManufacturerContract to a Manufacturer data structure
    mapping(address => ManufacturerRecord) public manufacturerRecords;
    // Data structures to map the address of a EOA Manufacturer to a ManufacturerContract
    mapping(address => address ) private manufacturerMap;

    address[] ManufacturerContractIDs;

    // Map a vulnerabilityHash to the related manufacturer
    //mapping(bytes32 => address) public ManufacturerVulnerabilities; 

    /**
        Structs and Enums
     */

    // Data structure of a Manufacturer, including the address of its smart contract, and the registration variables
    struct ManufacturerRecord {
        bytes32 name;
        uint32 registeredSince;   // registration timestamp
        uint32 unregisteredSince;   // unregistration timestamp
        bool registered;
    }


    /**
        @notice The constructor of the contract expects the Interledger address and the address of a ManufacturerFactory contract
        
     */
    constructor () {
        ManufacturerFactory _factory = new ManufacturerFactory();
        factory = _factory;
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        grantRole(AUTHORIY, msg.sender);
    }


    /**
        Events
     */

    event ManufacturerRegistered(address indexed manufacturer, address indexed manufacturerContract);
    event ManufacturerUnregistered(address indexed manufacturer);

   
    /**
        @notice Check if a manufacturer is regitered
        @param _manufacturer The manufacturer EOA
        @return registered True if the manufacturer is registered, false otherwise
        @dev Internal function
     */     
    function isManufacturerRegistered(address _manufacturer)
        internal
        view
        returns (bool registered) {

        address _manufacturerContract= manufacturerMap[_manufacturer];
        registered = manufacturerRecords[_manufacturerContract].registered && manufacturerRecords[_manufacturerContract].unregisteredSince == 0;
    
    }

    /**
        Methods
     */


    /**
        Manufacturer's related methods
     */

    /**
        @notice Register a new manufacturer, i.e. create a new ManufacturerContract through the Factory
        @param _manufacturer The address of manufacturer EOA to register (and owner of the ManufacturerContract)
        @param _name manufacturer name
        @dev Emits an event ManufacturerRegistered(address indexed _manufacturer, address _manufacturerContract) with the address of the manufacturer and the new ManufacturerContract respectively
        @dev Only the Authority owner
     */
    function registerManufacturer(address _manufacturer, bytes32 _name)  external {
        require(hasRole(AUTHORIY, msg.sender));
        require(!isManufacturerRegistered(_manufacturer), "This manufacturer already exists");

        ManufacturerContract contractManufacturerAddress = factory.createManufacturerContract(_manufacturer);
        ManufacturerRecord memory record = ManufacturerRecord({ 
                                                    name:_name,
                                                    registeredSince: uint32(block.timestamp),
                                                    unregisteredSince: 0,
                                                    registered: true
                                                });

        manufacturerRecords[address(contractManufacturerAddress)] = record;
        manufacturerMap[_manufacturer]=address(contractManufacturerAddress);
        ManufacturerContractIDs.push(address(contractManufacturerAddress));
        emit ManufacturerRegistered(_manufacturer, address(contractManufacturerAddress));
    }

    /**
        @notice Un-register a manufacturer
        @param _manufacturer The address of manufacturer EOA to un-register
        @dev Emits an event ManufacturerUnregistered(address indexed _manufacturer) with the address of the manufacturer EOA
        @dev Only the Authority owner
     */
    function unregisterManufacturer(address _manufacturer)  external {
        require(hasRole(AUTHORIY, msg.sender));
        require(isManufacturerRegistered(_manufacturer),"This manufacturer is already unregistered");

        // Deactivate the Manufacturer contract
        address _manufacturerContract= manufacturerMap[_manufacturer];
        ManufacturerRecord storage record = manufacturerRecords[_manufacturerContract];
        record.registered = false;
        record.unregisteredSince = uint32(block.timestamp);
        emit ManufacturerUnregistered(_manufacturer);
    }

    function getManufacturerContractbyAddress(address _manufacturer) public view returns (address _manufacturerContract){
        return manufacturerMap[_manufacturer];
    }

    
   
  
}

