// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import {Structs} from "./utils/qualityInfrastrucutureLib.sol";


/**
    @title ManufacturerContract
    @notice This contract reflects the Manufacturer in the ARD process. Inherits from OpenZeppelin Ownable
 */
contract ManufacturerContract is Ownable {


    /**
        Contract state attributes
     */

    // Address of the authority contract
    address public authority;
    
    mapping (bytes32 => Structs.Device) public Devices; // mapping deviceId => Device data structure
    bytes32[] public deviceIdx;                         // a list of manufacturer's devices by device id



    /**
        Events
     */

    event DeviceRegistered(bytes32 indexed deviceId);
    event DeviceUnregistered(bytes32 indexed deviceId);


    /**
        Modifiers and utility functions
     */

    modifier onlyAuhtority {
        require(msg.sender == authority, "The caller is not the authority contract");
        _;
    }

    /**
        @notice The constructor of the contract expects the EOA manufacturer address to transfer the ownership to, and the address the Authority smart contract
        @param _manufacturer The address of the manufacturer EOA
        @param _authority The address of the AuthorityContract
     */
    constructor (address _manufacturer, address _authority) {

        authority = _authority;
        transferOwnership(_manufacturer); // Otherwise the owner is the Authority contract
    }


    /**
        Methods
    */
    
    /**
        Manufacturer's related methods
     */


    /**
        @notice Register a device in the contract
        @param _deviceName The device name, string
        @dev Emits DeviceRegistered(bytes32 indexed _deviceId)
        @dev Only the owner
    */
     function registerDevice(bytes32 _deviceName, bytes32 _serial) onlyOwner external {

        bytes32 _deviceId = keccak256(
            abi.encodePacked(
            address(this),
            _deviceName,
            _serial
            )
        );

        require(!Devices[_deviceId].registered, "This device is already registered");

        Structs.Device memory newDevice = Structs.Device({
                                                deviceManufacturer:address(this),
                                                deviceName:_deviceName,
                                                serial:_serial,
                                                registeredSince:uint32(block.timestamp),
                                                unregisteredSince:0,
                                                registered:true
                                                });

        Devices[_deviceId] = newDevice;     // Store in the map the new pair (_deviceId, newDevice)
        deviceIdx.push(_deviceId);          // Store manufacturer address in array

        emit DeviceRegistered(_deviceId);
    }

    /**
        @notice Unregister a device in the contract
        @param _deviceId The id of the device, bytes32
        @dev Emits DeviceUnregistered(bytes32 indexed _deviceId)
        @dev Only the owner
    */
    function unregisterDevice(bytes32 _deviceId) onlyOwner external {

        // Remove (de-activate) device from the smart. contract
        Structs.Device storage p = Devices[_deviceId];
        require(p.registered, "A device must be registered to un-register it");

        p.registered = false;
        p.unregisteredSince = uint32(block.timestamp);

        emit DeviceUnregistered(_deviceId);
    }
  
    /**
        Getters and utility functions
     */


    /**
        @notice Get a device by its unique identifier, in bytes
        @param _deviceId The index of the device, uint
        @return deviceManufacturer The contract address of the manufacturer
        @return deviceName The name the device, string
        @return serial The device serial number 
        @return registeredSince The timestamp of the registration date of the manufacturer
        @return unregisteredSince The timestamp of the unregistration date of the manufacturer (0 if still registered)
        @return registered True if the manufacturer is registered, false otherwise
    */
    function getDeviceByUniqueId(bytes32 _deviceId) public view returns(
        address  deviceManufacturer,
        bytes32  deviceName,
        bytes32  serial,
        uint32 registeredSince,
        uint32 unregisteredSince,
        bool registered) {
        Structs.Device memory d = Devices[_deviceId];
        return (d.deviceManufacturer,d.deviceName,d.serial, d.registeredSince, d.unregisteredSince, d.registered);
     }

}

contracts/ManufacturerFactory.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./ManufacturerContract.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
    @title ManufacturerFactory
    @notice This contract has the job to instantiate ManufacturerContract. This contract works only after its ownership will be tranfered. Inherits from OpenZeppelin Ownable
    @dev Letting the AuthorityContract create the ManufacturerContract, it would not be deployable due to bytecode too large
 */
contract ManufacturerFactory is Ownable {

    bool public working = true;
    mapping(address => bool) public contracts;

    /**
        @notice Instantiate a contract of type ManufacturerContract with _manufacturer as its owner
        @dev This function reverts if ownership has not been tranfered 
        @param _manufacturer The owner of the new ManufacturerContract
     */
    function createManufacturerContract(address _manufacturer) onlyOwner public virtual returns(ManufacturerContract) {

        require(working == true, "Factory is not working");

        ManufacturerContract c = new ManufacturerContract(_manufacturer, msg.sender);
        contracts[address(c)] = true;

        return c;
    }

    /**
        @notice Override OpenZeppelin transfer method to unlock the creation method 
        @param newOwner The new owner
     */
    function transferOwnership(address newOwner) onlyOwner public virtual override {
        super.transferOwnership(newOwner);
        working = true;        
    }
}

